from collections import deque


class MyQueue:
    def __init__(self, initial_values):
        self.queue = initial_values
        self.size = len(initial_values)
        self.min_queue = deque(maxlen=self.size)
        self.max_queue = deque(maxlen=self.size)

    def pop(self):
        self.size -= 1
        return self.queue.pop()

    def push(self, item):
        self.size += 1
        self.queue.append(item)

    def min(self):
        return self.min_queue[-1] if self.min_queue else sys.maxsize

    def max(self):
        return self.max_queue[-1] if self.max_queue else -sys.maxsize

    def min_push(self, item):
        if item < self.min():
            self.min_queue.append(item)
        else:
            self.queue.append(item)

    def max_push(self, item):
        if item > self.max():
            self.max_queue.append(item)
        else:
            self.queue.append(item)

