from typing import Callable, List, NamedTuple

from icontract import require, ensure, DBC


class Point(NamedTuple):
    row: int
    column: int


class Row(NamedTuple):
    start: int
    end: int


class Column(NamedTuple):
    start: int
    end: int


class Solution:
    """
    Number of choices of rows and columns to make K black squares remain in a grid of H rows and W columns.
    """

    @require(lambda H, W, K: K > 0)
    @require(lambda H, W, K: H > 0)
    @require(lambda H, W, K: W > 0)
    @require(lambda H, W, K: H + W >= K)
    def count(self, H: int, W: int, K: int) -> int:
        """
        Number of choices of rows and columns to make K black squares remain in a grid of H rows and W columns.
        """

        def make_row_choices(r: int, max_i: int) -> int:
            """
            Number of choices of columns to make K black squares remain in the row with index `r`.
            """
            return ((max_i - r) * r) // 2 + r + 1

        return self.count_recursive(H, W, K, make_row_choices)

    @require(lambda H, W, K: K > 0)
    @require(lambda H, W, K: H > 0)
    @require(lambda H, W, K: W > 0)
    @require(lambda H, W, K: H + W >= K)
    def count_recursive(
        self, H: int, W: int, K: int, make_row_choices: Callable[[int, int], int]
    ) -> int:
        """
        Number of choices of rows and columns to make K black squares remain in a grid of H rows and W columns.
        """

        if K == 0:
            return 1

        if H == 0:
            return 0

        if K == 1:
            return make_row_choices(H, H)

        return (
            self.count_recursive(H - 1, W, K - 1, make_row_choices)
            + self.count_recursive(H - 1, W, K, make_row_choices)
            + self.count_recursive(H, W - 1, K - 1, make_row_choices)
        )


@ensure(lambda result: result >= 0)

