from functools import lru_cache

class Solution:
    def check(self, edges):
        """
        :type edges: List[List[int]]
        :rtype: bool
        """
        if not edges:
            return True

        count = 0
        for i in range(len(edges)):
            for j in range(len(edges)):
                if i == j:
                    continue
                if edges[i][0] == edges[j][1] or edges[i][1] == edges[j][0]:
                    count += 1
                    break

        return count <= 2

    def helper(self, edges, visited):
        """
        :type edges: List[List[int]]
        :type visited: List[bool]
        :rtype: bool
        """
        if not edges:
            return True

        if not self.check(edges):
            return False

        for i in range(len(edges)):
            if visited[i]:
                continue

            visited[i] = True
            if self.helper(edges, visited):
                return True

            visited[i] = False

        return False

    def solve(self, n, m, edges):
        visited = [False] * m
        return 'YES' if self.helper(edges, visited) else 'NO'

