class Graph:
    def __init__(self, n: int):
        self.n = n
        self.parent = [None] * n
        self.rank = [0] * n

    def make_set(self, x: int) -> None:
        self.parent[x] = x
        self.rank[x] = 0

    def union(self, x: int, y: int) -> None:
        xr, yr = self.find(x), self.find(y)
        if xr == yr:
            return
        if self.rank[xr] > self.rank[yr]:
            self.parent[yr] = xr
        else:
            self.parent[xr] = yr
            if self.rank[xr] == self.rank[yr]:
                self.rank[yr] += 1

    def find(self, x: int) -> int:
        while x!= self.parent[x]:
            x = self.parent[x]
        return x

