import math

from collections import deque

from dataclasses import dataclass

from dataclasses_json import dataclass_json


@dataclass_json
@dataclass
class Point:
    x: float
    y: float

    def __add__(self, other: Point) -> Point:
        return Point(self.x + other.x, self.y + other.y)

    def __sub__(self, other: Point) -> Point:
        return Point(self.x - other.x, self.y - other.y)

    def __mul__(self, scalar: float) -> Point:
        return Point(self.x * scalar, self.y * scalar)

    def __rmul__(self, scalar: float) -> Point:
        return self.__mul__(scalar)

    def __eq__(self, other: Point) -> bool:
        return math.isclose(self.x, other.x) and math.isclose(self.y, other.y)

    def __hash__(self):
        return hash((self.x, self.y))

    def __str__(self):
        return f'({self.x}, {self.y})'


@dataclass_json
@dataclass
class Line:
    p1: Point
    p2: Point

    def __eq__(self, other: Line):
        return self.p1 == other.p1 and self.p2 == other.p2

    def __hash__(self):
        return hash((self.p1, self.p2))


@dataclass_json
@dataclass
class Circle:
    center: Point
    radius: float

    def __eq__(self, other: Circle):
        return math.isclose(self.radius, other.radius) and self.center == other.center

    def __hash__(self):
        return hash((self.center, self.radius))


@dataclass_json
@dataclass
class Polygon:
    vertices: list[Point]

    def edges(self) -> list[Line]:
        return [Line(self.vertices[i], self.vertices[i + 1]) for i in range(len(self.vertices) - 1)]

    def diagonals(self) -> list[Line]:
        return [Line(self.vertices[i], self.vertices[i + 1]) for i in range(len(self.vertices) - 1)] + [
            Line(self.vertices[i], self.vertices[0]) for i in range(1, len(self.vertices))]

    def intersections(self) -> int:
        queue = deque()
        intersections = 0
        for diagonal in self.diagonals():
            queue.append(diagonal)
            while len(queue) > 1:
                first = queue.popleft()
                second = queue.popleft()
                if first.p1 == second.p1 or first.p1 == second.p2 or first.p2 == second.p1 or first.p2 == second.p2:
