class Solution:
    """Solution for Aufgabe 2"""

    def max_kill(self, r, s, k):
        """
        :param r: length of picture
        :param s: length of side of the racket
        :param k: length of side of the side of the racket
        :return: maximal number of flies that can be killed in a single shot
        """
        # input parsing
        picture = [input().split() for _ in range(r)]
        for row in picture:
            for char in row:
                if char!= '.':
                    raise Exception(
                        'All picture pixels should be ".", but got "{}"'.format(char)
                    )
        # horizontal position of the racket
        rh = (len(picture[0]) - k) // 2
        # vertical position of the racket
        rv = (len(picture) - k) // 2
        # minimal number of shots
        min_shots = 1
        # final result
        res = 0
        for _ in range(r):
            if picture[_][rh] == '*':
                res += 1
                if picture[_][rh + k] == '*':
                    res += 1
                if picture[_][rh + 2 * k] == '*':
                    res += 1
            elif picture[_][rh + k] == '*':
                res += 1
            if picture[_][rv] == '*':
                res += 1
                if picture[_][rv + k] == '*':
                    res += 1
                if picture[_][rv + 2 * k] == '*':
                    res += 1
            elif picture[_][rv + k] == '*':
                res += 1
            # if the total number of kills is greater than the previous one,
            # we have to update it
            if res > min_shots:
                min_shots = res
            res = 0
        return min_shots


