@dataclass(frozen=True)
class DailyTemps:
    max_temp: int
    min_temp: int

class Solution:
    """
    Since the minimum temperature will be lower than the maximum temperature
    during the two-day hiking trip, we can know that the temperature on the 
    start day will be greater than the temperature on the end day. Hence, we can
    start by looking for the first day that will have a temperature that is 
    greater than or equal to our end temperature.
    """
    @staticmethod
    def find_start_day(temps: List[DailyTemps], end_temp: int) -> int:
        start_idx, end_idx = 0, len(temps) - 1
        while start_idx < end_idx:
            mid_idx = (start_idx + end_idx) // 2
            mid_temp = temps[mid_idx].max_temp
            if mid_temp < end_temp:
                start_idx = mid_idx + 1
            elif mid_temp > end_temp:
                end_idx = mid_idx
            else:
                return mid_idx
        return start_idx

    @staticmethod
    def is_greater_than_or_equal(day_temps: List[DailyTemps], end_temp: int) -> bool:
        for i, t in enumerate(day_temps):
            if t.max_temp <= end_temp:
                return False
        return True

    @staticmethod
    def minimum_temperature(day_temps: List[DailyTemps]) -> int:
        return min(day_temps, key=lambda t: t.max_temp).max_temp

    def solve(self, input_file: str) -> str:
        n = int(next(sys.stdin))
        temps = [DailyTemps(int(t) for t in next(sys.stdin).split()) for _ in range(n)]
