from __future__ import annotations
from collections import defaultdict

class Solution:
    def calc_level(self, people: dict) -> dict:

        # Level is zero if no one speaks the same language
        level = [0] * (max(people.keys()) + 1)
        for p in people:
            for n in people[p]:
                level[n] = max(level[n], level[p] + 1)
        return level

    def max_level(self, levels: list) -> int:
        return max(levels)

    def main(self, stdin: str) -> str:
        n = int(stdin)
        people = defaultdict(list)
        for i in range(n):
            people[i] = list(map(int, stdin.split()))

        levels = self.calc_level(people)
        return str(self.max_level(levels))

