from string import ascii_lowercase
from typing import List, Dict, Set

from icontract import require, ensure, DBC


class Language(DBC):
    """Represent a language."""

    @require(lambda name: len(name) >= 1)
    @require(lambda name: name[0] in ascii_lowercase)
    @require(lambda name: name[-1] in ascii_lowercase)
    def __init__(self, name: str) -> None:
        """Initialize with a language name."""
        self.name = name

    @ensure(lambda self, name: self.name == name)
    def __eq__(self, other: "Language") -> bool:
        """Return True if both languages are same."""
        return self.name == other.name

    @ensure(lambda self, name: self.name!= name)
    def __ne__(self, other: "Language") -> bool:
        """Return True if both languages are not same."""
        return self.name!= other.name

    @ensure(lambda self: self.name.islower())
    def __repr__(self) -> str:
        """Represent the language as a lowercase string."""
        return self.name


class Char(DBC):
    """Represent a character."""

    @require(lambda name: len(name) >= 1)
    @require(lambda name: name[0] in ascii_lowercase)
    @require(lambda name: name[-1] in ascii_lowercase)
    def __init__(self, name: str) -> None:
        """Initialize with a character name."""
        self.name = name

    @ensure(lambda self, name: self.name == name)
    def __eq__(self, other: "Char") -> bool:
        """Return True if both characters are same."""
        return self.name == other.name

    @ensure(lambda self, name: self.name!= name)
    def __ne__(self, other: "Char") -> bool:
        """Return True if both characters are not same."""
        return self.name!= other.name

    @ensure(lambda self: self.name.islower())
    def __repr__(self) -> str:
        """Represent the character as a lowercase string."""
        return self.name


class LanguageConversation(DBC):
    """Represent a language conversation."""

    def __init__(
        self, character: Char, languages: Dict[Language, int]
    ) -> None:
        """Initialize with a character and a mapping of languages to number of
        conversations."""
        self.character = character
        self.languages = languages

    def __eq__(self, other: "LanguageConversation") -> bool:
        """Return True if both language conversations are the same."""
        return self.character == other.character and self.languages == other.languages

    def __ne__(self, other: "LanguageConversation") -> bool:
        """Return True if both language conversations are not the same."""
        return not (self == other)

    def __repr__(self) -> str:
        """Represent the conversation as a string."""
        return f"{self.character} {self.languages}"


class Character:
    """Represent a character."""

    def __init__(self, name: str, languages: Set[Language]) -> None:
        """Initialize with a character name and a set of languages the character
        speaks."""
        self.name = name
        self.languages = languages

    def __repr__(self) -> str:
        """Represent the character as a string."""
        return f"{self.name} {self.languages}"

