from collections import namedtuple

Event = namedtuple("Event", "action amount")


class Solution:
    def __init__(self, data: str):
        events = []
        for line in data.split("\n"):
            if line:
                events.append(self.parse(line))
        self.events = sorted(events)

    def parse(self, line: str) -> Event:
        action, amount = line.split()
        return Event(action, int(amount))

    def parse_data(self):
        return self.events

    def solve(self) -> str:
        profit = 0
        for event in self.events:
            if event.action == "buy":
                profit += event.amount
            elif event.action == "sell":
                profit -= event.amount
            elif event.action == "split":
                profit += event.amount / 2
            elif event.action == "merge":
                profit += event.amount * 2
            else:
                profit += event.amount * 0.3
        return f"{profit:.2f}"

